import React from 'react';
import './App.css';

function App() {
  // Hardcoded data for the mockup
  const colors = ['#FF5733', '#33FF57', '#3357FF', '#F5B041', '#8E44AD'];
  const percentages = [40, 25, 15, 10, 10];

  return (
    <div className="App">
      <h1 className="title">Image Color Palette</h1>
      <button className="upload-button">Upload Image</button>

      {/* Color blocks container */}
      <div className="color-container">
        {colors.map((color, index) => (
          <div key={index} className="color-block" style={{ width: `${percentages[index]}%`, backgroundColor: color }}>
            <div className="hex-code">{color}</div>
            <div className="percentage">{percentages[index]}%</div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
